window.bookSummaryJSON = "<p><b>Wanting anything resembling what I had should suffocate me.</b> </p> <p>Meeting my neighbor, Obrecht Ivanov, confuses me. The moment he walks through my door, I desperately want him to command me to kneel. I swore I would never return to anything like life with my ex-husband. So why do I feel as if I can’t breathe? </p> <p>Each passing day that I don’t cave into my desires, the tension in my soul exponentially tightens. I convince myself to go take care of it and stop the itch once and for all. Just one time and then I’ll be fine. </p> <p>It’s bad enough my ex-husband is doing everything in his power to find me. The choice I make puts me in a dangerous and vulnerable position. It’s a good thing Obrecht is always watching me. </p> <p><b>He’s my savage tracker....</b></p> <p><b>Savage Tracker</b><b><i> is the jaw-dropping fifth installment of the Mafia Wars series. It’s an interconnecting stand-alone dark mafia romance, guaranteed to have an HEA. Please note: This contains scenes and topics that may be uncomfortable for some listeners.</i></b></p>"; 
